class Solution:
    def maxOperations(self, s: str) -> int:
        a=0
        o=0
        t=False
        b=[]
        for i in s:
            if i=="1":
                b.append(1)
                t=True
            elif i=="0" and t:
                b.append(0)
                t=False
        for i in b:
            if i==1:
                o=o+1
            else:
                a=a+o
        return a
